import React,{useState} from 'react';
import './TotalTargetTime.scss' 
const TotalTargetTime=()=>{

    const[timeArr,setTimeArr]=useState([1,2,5,9,1,2])
    console.log(timeArr)
    const handleChange=event=>{
        setTimeArr(event.target.value)
    }
    return(
        <div className='timcardsContainer'>
            <input className='timeBox' value={timeArr[0]}>
            </input>
            <input className='timeBox' value={timeArr[1]}>
            </input>
            <div className='timerText'>h</div>
            <input className='timeBox' value={timeArr[2]}>
            </input>
            <input className='timeBox' value={timeArr[3]}>
            </input>
                <div className='timerText'>m</div>
                <input className='timeBox' value={timeArr[4]}>
            </input>
            <input className='timeBox' value={timeArr[5]} onChange={handleChange}>
            </input>
                <div className='timerText'>s</div>

        </div>

    )
}

export default TotalTargetTime;
